output: ['.', '.', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'g', '.']

Test case:
input: ['.', '.', '.', '.', '.', 'e', 'e', 'e', 'e', '.', '.', '.', '.', '.', '.', '.', '.', '.', 'g']

###########################################################
Sample Outputs:
output: ['.', '.', '.', '.', '.', 'e', 'e', 'e', 'e', 'e', 'e', 'e', 'e', 'e', '.', '.', '.', '.', 'g']
*/

public class Solution {
    public String[] expand(String S) {
        List<String> res = new ArrayList<>();
        int len = 0;
        while (len < S.length()) {
            char c = S.charAt(len);
            if (c == '.') {
                res.add(".");
                len++;
            } else {
                StringBuilder sb = new StringBuilder();
                sb.append('.');
                sb.append(c);
                sb.append('.');
                int count = 1;
                while (++len < S.length() && Character.isDigit(S.charAt(len))) {
                    count *= 10;
                    count += Integer.parseInt(Character.toString(S.charAt(len)));
                }
                for (int i = 0; i < count - 1; i++) {
                    res.add(sb.toString());
                }
            }
        }
        String[] ans = new String[res.size()];
        for (int i = 0; i < res.size(); i++) {
            ans[i] = res.get(i);
        }
        return ans;
    }
}
